import React from "react";
import "./form.css";

const FormSection = () => {
  return (
    <>
      <div className="form-container">
        <div className="faq">
          <div className="box">
            <div className="bar-red"></div>
            <span>FAQ</span>
          </div>
          <h2>Frequently asked questions</h2>
          <ExpandToogle btnText={"What are the Benifits of Business"} />
        </div>
        <div className="form"></div>
      </div>
    </>
  );
};
export default FormSection;

function ExpandToogle(props) {
  return (
    <>
      <div className="toogle-container">
        <button className="toogle-expand">
          <div className="toogle-img"></div>
          <span>{props.btnText}</span>
        </button>
      </div>
    </>
  );
}
